	public void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException {
		doPost(request,response);
	}

	public void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException{
		Map<String,Object> map = new HashMap<String, Object>();
		List<Map<String,String>> list = new ArrayList<Map<String,String>>();
		map.put("flag", "normal");
		map.put("retcode", "1");
		map.put("msg", "比对成功");
		map.put("data", list);
		try {
			InputStream in = request.getInputStream();
			String data = StringUtil.convertStreamToString(in);
			int beginIndex =  data.indexOf("message=");
			int endIndex = data.lastIndexOf("}");
			String message = data.substring(beginIndex+8, endIndex+1);
			JSONObject jsonObject = JSONObject.fromObject(message);
			JSONObject dataObject = jsonObject.getJSONObject("data");
			String type = jsonObject.getString("type");
			String key = "";
//			InputStream blackListin = DkbdServlet.class.getResourceAsStream("/cn/lhkj/servlet/blackList.txt");
//			InputStream redListin = DkbdServlet.class.getResourceAsStream("/cn/lhkj/servlet/redList.txt"); 
//			String blackList = StringUtil.convertStreamToString(blackListin);
//			String redList = StringUtil.convertStreamToString(redListin);
			Random r = new Random();
			int i = r.nextInt(5);
			if("person".equals(type)){
				key = dataObject.getString("id");
//				if(redList.contains(key)){
				if(i==0){
					map.put("flag", "white");
//				}else if(blackList.contains(key)){
				}else if(i==1 || i==2){
					map.put("flag", "normal");
				}else{	
					map.put("flag", "black");
					Map<String,String> dataMap = new HashMap<String, String>();
					dataMap.put("uuid", UUIDFactory.getUUIDStr());
					dataMap.put("sfzh", key);
					dataMap.put("name", IdCardGenerator.randomName());
					dataMap.put("identlocation", "XX省XX市XX县XX小区XX号");
					dataMap.put("datasource", "人员标签");
					dataMap.put("action", "核录信息");
					dataMap.put("bkfwdm", "");
					dataMap.put("bkfwmc", "");
					dataMap.put("yjfwdm", "");
					dataMap.put("yjfwmc", "");
					list.add(dataMap);
				}
			}else if("plate".equals(type)){
				key = dataObject.getString("plate");
				if(i==0){
					map.put("flag", "white");
				}else if(i==1 || i==2){
					map.put("flag", "normal");
				}else{
//				if(redList.contains(key)){
//					map.put("flag", "white");
//				}else if(blackList.contains(key)){
					map.put("flag", "black");
					Map<String,String> dataMap = new HashMap<String, String>();
					dataMap.put("uuid", UUIDFactory.getUUIDStr());
					dataMap.put("plate", key);
					dataMap.put("car_type", "XXX品牌车辆");
					dataMap.put("sfzh", IdCardGenerator.randomIdcard());
					dataMap.put("name", IdCardGenerator.randomName());
					dataMap.put("identlocation", "XX省XX市XX县XX小区XX号");
					dataMap.put("tag", "登记车牌");
					dataMap.put("datasource", "人员标签");
					dataMap.put("action", "核录信息");
					dataMap.put("person_photo", person_photo.toString());
					dataMap.put("bkfwdm", "");
					dataMap.put("bkfwmc", "");
					dataMap.put("yjfwdm", "");
					dataMap.put("yjfwmc", "");
					list.add(dataMap);
				}
			}else if("mac".equals(type)){
				key = dataObject.getString("mac");
//				if(redList.contains(key)){
				if(i==0){
					map.put("flag", "white");
//				}else if(blackList.contains(key)){
				}else if(i==1 || i==2){
					map.put("flag", "normal");
				}else{	
					map.put("flag", "black");
					Map<String,String> dataMap = new HashMap<String, String>();
					dataMap.put("uuid", UUIDFactory.getUUIDStr());
					dataMap.put("sfzh", IdCardGenerator.randomIdcard());
					dataMap.put("mac", key);
					dataMap.put("name", IdCardGenerator.randomName());
					dataMap.put("identlocation", "XX省XX市XX县XX小区XX号");
					dataMap.put("datasource", "人员标签");
					dataMap.put("action", "核录信息");
					dataMap.put("bkfwdm", "");
					dataMap.put("bkfwmc", "");
					dataMap.put("yjfwdm", "");
					dataMap.put("yjfwmc", "");
					list.add(dataMap);
				}
			}else if("imei,imsi".equals(type)){
				key = dataObject.getString("imei");
//				if(redList.contains(key)){
				if(i==0){
					map.put("flag", "white");
//				}else if(blackList.contains(key)){
				}else if(i==1 || i==2){
					map.put("flag", "normal");
				}else{	
					map.put("flag", "black");
					Map<String,String> dataMap = new HashMap<String, String>();
					dataMap.put("uuid", UUIDFactory.getUUIDStr());
					dataMap.put("sfzh", IdCardGenerator.randomIdcard());
					dataMap.put("imei", key);
					dataMap.put("imsi", key);
					dataMap.put("name", IdCardGenerator.randomName());
					dataMap.put("identlocation", "XX省XX市XX县XX小区XX号");
					dataMap.put("datasource", "人员标签");
					dataMap.put("action", "核录信息");
					dataMap.put("bkfwdm", "");
					dataMap.put("bkfwmc", "");
					dataMap.put("yjfwdm", "");
					dataMap.put("yjfwmc", "");
					list.add(dataMap);
				}
			}
			map.put("key", key);
			map.put("type", type);
		} catch (Exception e) {
			map.put("flag", "normal");
			map.put("retcode", "-1");
			map.put("msg", e.getMessage());
		}
		printObj(map,response);
	}
	
	/**返回前台界面的json格式如{} */
	public void printObj(Object obj,HttpServletResponse response){
		JSONArray jsonarray = JSONArray.fromObject(obj);
		String resultstr = jsonarray.toString();
		response.setContentType("text/plain; charset=utf-8");
		try {
			PrintWriter out = response.getWriter();
			String result = resultstr.substring(1,resultstr.length()-1);
			System.out.println(result);
			out.print(result);
			out.flush();  
            out.close(); 
		} catch (IOException e) {}
	}
	
